const settings = {
    dots: true,
    infinite: true,
    speed: 2000,
    slidesToShow: 3,
    slidesToScroll: 1,
    autoplay: false,
    arrows: true,
    autoplaySpeed: 1000,
    beforeChange: (prev, next) => {
      this.setState({ currentSlide: next });
    },
    appendDots: dots => {
      return (
        <div>
          <ul>
            {dots.map((item, index) => {
              return (
                <li key={index}>{item.props.children}</li>
              );
            })}
          </ul>
        </div>
      )
    },  

    responsive: [
        {
          breakpoint: 1024,
          settings: {
            slidesToShow: 3,
            slidesToScroll: 3,
            infinite: true,
            dots: true
          }
        },
        {
          breakpoint: 600,
          settings: {
            slidesToShow: 2,
            slidesToScroll: 2,
            initialSlide: 2
          }
        },
        {
          breakpoint: 480,
          settings: {
            slidesToShow: 1,
            slidesToScroll: 1
          }
        }
      ]
  }; 

  export default settings
